-- ----------------------------
-- Table structure for order_info
-- ----------------------------
DROP TABLE IF EXISTS `order_info`;
CREATE TABLE `order_info` (
  `id` bigint(20) NOT NULL COMMENT '订单id',
  `order_no` varchar(20) NOT NULL COMMENT '订单号',
  `order_status` enum('UNPAID','PAID','FINISHED','CANCEL') DEFAULT NULL COMMENT '订单状态(UNPAID:待支付,PAID:已支付,FINISHED:已完成,CANCEL:已取消)',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '门店id',
  `payment_type` enum('OFFLINE','ONLINE') NOT NULL COMMENT '支付方式(OFFLINE:线下/到店支付,ONLINE:线上/在线支付)',
  `source_type` enum('IOS_VIEW','ANDROID_VIEW') DEFAULT NULL COMMENT '下单来源(IOS_VIEW:IOS微信小程序，ANDROID_VIEW:安卓微信小程序)',
  `cancel_time` datetime(3) DEFAULT NULL COMMENT '订单取消时间',
  `finish_time` datetime(3) DEFAULT NULL COMMENT '订单完成时间',
  `pay_time` datetime(3) DEFAULT NULL COMMENT '订单支付时间',
  `receiver_user_name` varchar(20) DEFAULT NULL COMMENT '收获人姓名',
  `receiver_mobile` varchar(20) DEFAULT NULL COMMENT '收获人手机号',
  `receiver_address` varchar(200) DEFAULT NULL COMMENT '收获地址',
  `coupon_details` varchar(500) DEFAULT NULL COMMENT '优惠详情',
  `item_amount` bigint(20) DEFAULT NULL COMMENT '商品总额',
  `actual_payment` bigint(20) DEFAULT NULL COMMENT '实际付款金额',
  `install_amount` bigint(20) DEFAULT NULL COMMENT '安装费用',
  `freight_amount` bigint(20) DEFAULT NULL COMMENT '运费',
  `promotion_amount` bigint(20) DEFAULT NULL COMMENT '优惠金额',
  `comment_status` enum('YES_COMMENT','NO_COMMENT') DEFAULT 'NO_COMMENT' COMMENT '是否评价(Y:已评价,N:未评价）',
  `service_status` enum('CANCEL','INSTALLING','BE_INSTALLED','BE_RESERVED','BE_SEND_BILL','SEND_BILL') DEFAULT NULL COMMENT 'SEND_BILL("派单中"),BE_SEND_BILL("待派单"),BE_RESERVED("待预约"),BE_INSTALLED("待安装"),INSTALLING("安装完成"),CANCEL("取消")',
  `deliver_type` enum('GO_SHOP','GO_HOME') DEFAULT NULL COMMENT '送货方式(GO_SHOP：到店,GO_HOME:到家)',
  `is_gift` enum('N','Y') DEFAULT 'N' COMMENT '是否存在赠品',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '优惠券id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `car_model` varchar(500) DEFAULT NULL COMMENT '车型一、二级信息',
  `pay_id` varchar(50) DEFAULT NULL COMMENT '支付指令id',
  `car_detail` varchar(5000) DEFAULT NULL COMMENT '车型详情',
  `created_time` datetime(3) NOT NULL COMMENT '创建时间',
  `updated_time` datetime(3) NOT NULL COMMENT '更新时间',
  `creator` varchar(20) NOT NULL COMMENT '创建人',
  `modifier` varchar(20) NOT NULL COMMENT '更新人',
  `addition` varchar(512) DEFAULT NULL COMMENT '扩展字段',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `is_deleted` char(1) NOT NULL DEFAULT 'N' COMMENT '是否删除',
  PRIMARY KEY (`id`),
  KEY `ix_order_no` (`order_no`) USING BTREE,
  KEY `ix_order_status` (`order_status`) USING BTREE,
  KEY `ix_created_time` (`created_time`) USING BTREE,
  KEY `ix_is_deleted` (`is_deleted`) USING BTREE,
  KEY `ix_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单主表';

